import React, { useState } from 'react';
import './App.css';
import { data } from "./mock/data";
import { DragComponent } from "./dragComponent";

function App() {
  const [originData, setData] = useState(data);

  return (
    <div className="App">
      <DragComponent data={originData} sortData={setData}/>
    </div>
  );
}

export default App;
